import React from 'react';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';

export default function Home(props:any){
  return (
    <Container fluid={true} style={ props.style }>
      <Card>Home section
      </Card>
    </Container>
  );
}
